import { BrowserRouter, Route, Routes } from 'react-router-dom';
import About from './components/About';
import Home from './components/sections/Home';

function App() {
  return (
    <>
    <BrowserRouter>
      <Home/>
      <Routes>
        <Route exact path='/' exact element={<Home />} />
        <Route path='/about' element={<About/>} />

      </Routes>
    </BrowserRouter>
    </>
  );
}

export default App;
